import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import Rotas from './pages/Rotas';

class App extends React.Component {
  render() {
    return (
      <BrowserRouter>
        <div>
          <p>TrybeTunes</p>
          <Rotas />
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
